import React, { Component, PropTypes as RPT } from 'react';
import { Actions } from 'react-native-router-flux';
import { inject, observer } from 'mobx-react/native';
import { Image, StyleSheet, Text, TouchableOpacity, View } from 'react-native';

const czIcon = 'data:image/png;base64,';
const ruIcon = 'data:image/png;base64,';
const archiveIcon = 'data:image/png;base64,';
const tagsIcon = 'data:image/png;base64,';

@inject(({ uiStore }) => ({
  archived: uiStore.archived,
  language: uiStore.language,
  setLanguage: uiStore.setLanguage,
  showArchived: uiStore.showArchived
}))
@observer
export default class ListFooter extends Component {

  static propTypes = {
    archived: RPT.bool.isRequired,
    language: RPT.string.isRequired,
    setLanguage: RPT.func.isRequired,
    showArchived: RPT.func.isRequired
  }

  render() {
    const { archived, language, showArchived, setLanguage } = this.props;

    return (
      <View style={styles.container}>
        <TouchableOpacity style={styles.button} onPress={() => { setLanguage('cz'); }}>
          <Image style={styles.image} source={{ uri: czIcon }} />
          <Text style={[styles.label, language === 'cz' && styles.labelSelected]}>Czech</Text>
        </TouchableOpacity>

        <TouchableOpacity style={styles.button} onPress={() => { setLanguage('ru'); }}>
          <Image style={styles.image} source={{ uri: ruIcon }} />
          <Text style={[styles.label, language === 'ru' && styles.labelSelected]}>Russian</Text>
        </TouchableOpacity>

        <TouchableOpacity style={styles.button} onPress={showArchived}>
          <Image style={styles.image} source={{ uri: archiveIcon }} />
          <Text style={[styles.label, archived && styles.labelSelected]}>Archived</Text>
        </TouchableOpacity>

        <TouchableOpacity style={styles.button} onPress={Actions.tags}>
          <Image style={styles.image} source={{ uri: tagsIcon }} />
          <Text style={styles.label}>Tags</Text>
        </TouchableOpacity>
      </View>
    );
  }
}

const styles = StyleSheet.create({
  container: {
    padding: 4,
    flexDirection: 'row',
    alignItems: 'center',
    justifyContent: 'space-around',
    backgroundColor: '#F9F9F9',
    borderTopWidth: StyleSheet.hairlineWidth,
    borderTopColor: '#8E8E8E',
    position: 'absolute',
    bottom: 0,
    left: 0,
    right: 0
  },

  button: {
    alignItems: 'center',
    justifyContent: 'center'
  },

  image: {
    width: 30,
    height: 30,
    resizeMode: 'contain'
  },

  label: {
    fontSize: 10,
    color: '#8E8E8E',
  },

  labelSelected: {
    color: '#000000'
  }
});
